import { Box ,Card,CardMedia,Typography } from '@mui/material'
import { Link } from 'react-router-dom'
import React from 'react'
import PropertyData from '../../Assets/Data/PropertyData'
import Slider from 'react-slick'
import { Stack } from '@mui/system'
const PropertyListing = () => {
  var settings = {
    dots: true,
    infinite: false,
    speed: 500,
    slidesToShow: 4,
    slidesToScroll:4,
    initialSlide: 0,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 3,
          slidesToScroll: 3,
          infinite: true,
          dots: true
        }
      },
      {
        breakpoint: 600,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2
        }
      },
      {
        breakpoint: 480,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1
        }
      }
    ]
  };
  return (
    <Box pt={3}>
         
         <Typography variant='h5' component='div' fontWeight={600}>
        Recently Added
      </Typography>
      <Typography variant='subtitle1' style={{textDecoration:'none'}}>
        
      </Typography>

      <Slider {...settings}>
      
           {PropertyData.map((item)=> (
            <Stack direction='row' spacing={4} mt={2}>
              <Card style={{width:'90%'}} spacing={4}>
                     <CardMedia component='img'
                      image={item.image}
                      alt='/'
                      height='200px'
              
                       />

                       
                    <Box mx={1} mt={0} mb={0}>
                    <Typography variant='h6' fontWeight={600}>
                    {item.title}
                     </Typography>  
                    <Typography>
                    Price: <span style={{color:'red'}}> {item.price}</span>
                     </Typography>
                     <Typography>
                    {item.type}
                     </Typography> 
                    </Box>
            </Card>
            </Stack>
            
           ))}
      </Slider>     

       

    </Box>
  )
}

export default PropertyListing
